import React, { useState, useEffect } from "react";

const City = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("http://localhost:8005/getAllUser", {
      method: "GET",
    })
      .then((res) => res.json())
      .then((data) => {
        setData(data.data);
      });
  }, []);
  return (
    <>
    </>
  )
  
};

export default City;
